scriptlet.script:
// This template shows how to access operation return data, inputs and context data 
// and how to set context data, responses and results. 

// To get value associated with the context key myContextKey: 
query_results = scriptletContext.get("query_results"); 
queryCount = scriptletContext.get("queryCount"); 
fecha_proceso = scriptletContext.get("fecha_proceso");
UIM_MES_FACT = scriptletContext.get("UIM_MES_FACT");
UIM_ANIO_FACT = scriptletContext.get("UIM_ANIO_FACT");

var d = new Date();
var curr_date = d.getDate();
var curr_month = d.getMonth()+1;
var curr_year = d.getFullYear();
var UIM_FECHA_PROCESO = curr_year+"-"+curr_month+"-"+curr_date;

var insert="";
var insert2="";

if(queryCount > 0){
    insert+="BEGIN\n"; 
	linea = query_results.split("\n");
	for(i=0; i < linea.length; i++){
	    linea2 = linea[i].split(",");
	    if(linea2.length > 0){
	    	linea_insert = '';
	    	linea_insert += "'"+linea2[0]+"',";
	    	linea_insert += "'"+linea2[1]+"',";
	    	linea_insert += linea2[2]+",";
	    	linea_insert += linea2[3]+",";
	    	linea_insert += linea2[4]+",";
	    	linea_insert += linea2[5]+",";
	    	linea_insert += linea2[6]+",";
	    	linea_insert += linea2[7]+",";
	    	linea_insert += linea2[8]+",";
	    	linea_insert += linea2[9]+",";
	    	linea_insert += linea2[10]+",";
	    	linea_insert += linea2[11]+",";
	    	linea_insert += linea2[12]+",";
	    	linea_insert += linea2[13];
		  } 

	    insert+='INSERT INTO TBL_RED_USO_INFRA_MENSUAL (UIM_FECHA_PROCESO,UIM_BAN_CODIGO_BANCO,UIM_CODIGO_BANCO,UIM_TOTAL_TNX,UIM_TOTAL_TNX_EMI,UIM_TOTAL_TNX_ADQ,UIM_TOTAL_TNX_SD1,UIM_TOTAL_TNX_SD2,UIM_TOTAL_TNX_SD3,UIM_TOTAL_TNX_SD4,UIM_TOTAL_TNX_SD5,UIM_TOTAL_TNX_SD6,UIM_SUBTOTAL,UIM_IVA,UIM_TOTAL,UIM_SERVICIO,UIM_DESCRIPCION,UIM_MES_FACT,UIM_ANIO_FACT) VALUES (to_date("'+UIM_FECHA_PROCESO+'","yyyy-mm-dd"),'+linea_insert+','+'"BON"'+','+'"ACLA POR DIA"'+','+UIM_MES_FACT+','+UIM_ANIO_FACT+');\n';
		insert2+=UIM_FECHA_PROCESO+','+linea_insert+','+'"BON"'+','+'"LIQ ACLA POR DIA"'+','+UIM_MES_FACT+','+UIM_ANIO_FACT+'\n';
		insert = insert.replace(/\"/g,"'");
		insert = insert.replace(/null/g,"''");
	} // fin for
	insert+="COMMIT;\n";
	insert+="END;";
} // fin if


// Use the context to hold data for use by other steps.  It is also helpful to place information 
// into the context to examine variables when developing and debugging scriptlets. 
// For example to place the OutputString information into a context key called 'Output': 

scriptletContext.putGlobal("INSERT_SENTENCE", insert);
scriptletContext.putGlobal("INSERT_SENTENCE2", insert2);  

