staticBinding.value:
UPDATE TBL_RED_USO_INFRA_TARIFAS B 
SET B.UIT_IMPORTE_TARIFA_PSOS = ${TIPO_CAMBIO} 
WHERE TRIM(B.UIT_OPERACION)='TIPO DE CAMBIO'

